import React from 'react';
import './footer.css';

class Footer extends React.Component {
    render() {
        return (
            <div className="ftr-main">
                <ul>
                    <li >github</li>
                    <li>linkedIN</li>
                    <li>Fiverr</li>
                    <li>Email</li>
                </ul>
            </div>
        )
    }
}

export default Footer;
